import { View, Text ,StyleSheet} from 'react-native'
import React from 'react'
import { Avatar, Button, Card, Title, Paragraph } from "react-native-paper";


export default function DetailsPage({data}) {
    console.log("data",data);
  return (
    <Card>
        <Card.Title/>
        <Card.Cover/>
        <Card.Cover/>
    </Card>
  )
}
